const dialogsPageState = {
    dialogs: [
        {id: "1", userName: "Danila"},
        {id: "2", userName: "Vasya"},
        {id: "3", userName: "Petya"},
    ],
    messages: [
        { text: "Hi" },
        { text: "How are you" },
        { text: "Great" },
        { text: "And You" },
    ]
}

const dialogsReducer = (state, action) => {
  switch (action.type) {
    case "":
      return state;
    default:
      return state;
  }
};

export default dialogsReducer;
